  const { searchData, searchWords } = useAppSelector(state => state.searchData);
  console.log(searchWords);

  interface props {
    data: { sickCd: string; sickNm: string }[];
  }
  let sick: string[] = searchData;

  // 배열의 객제
  const value = sickNmMap({ sick });

  return <div></div>;
}

export default RecommendWords;
